def rescale_to(
    numbers: list,
    target_range: tuple,
    method="linear",
    extrapolate=True,
) -> List[float]:

    assert len(target_range) == 2, "target_range must be a tuple of two elements"
    lower, upper = target_range
    if numbers:
        if method == "linear":

            if extrapolate:
                if numbers[-1] > upper:
                    raise ValueError("Numbers must be within the specified range.")
                if numbers[-1] < lower:
                    raise ValueError("Numbers must be within the specified range.")
            else:
                if numbers[-1] < upper or numbers[-1] > lower:
                    raise ValueError("Numbers must be within the specified range.")
        else:
            raise ValueError("Method must be either 'linear' or beyond.")

    return np.linspace(lower, upper, numbers)

